import re


def find_video_links(code_string):
    """
    Extracts video links from the provided HTML and JavaScript code,
    specifically by looking for the jwplayer setup configuration.

    Args:
      code_string: A string containing the HTML and JavaScript code.
                   This string MUST be a raw string (e.g., r'''...''')
                   to avoid syntax warnings.

    Returns:
      A list of video URLs found in the jwplayer 'sources' configuration.
    """

    # This regex finds the 'sources' array within the jwplayer setup.
    # re.DOTALL allows '.' to match newlines.
    sources_pattern = re.compile(r"['\"]?sources['\"]?\s*:\s*(\[.*?\])", re.DOTALL)

    match = sources_pattern.search(code_string)

    # If no 'sources' block is found, return an empty list.
    if not match:
        return []

    # Extract the content of the 'sources' array.
    sources_block = match.group(1)

    # This regex finds all 'file' properties and captures their URL values.
    file_pattern = re.compile(r"['\"]file['\"]\s*:\s*['\"]([^'\"]+)['\"]")

    video_links = file_pattern.findall(sources_block)

    return video_links


